'Action commissions'=>'Actie commissies',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Actie commissies functie bieden de mogelijk per actie, of per \'"alles" commissies te bepalen.<br/>Op deze manier kunt commissies bepalen bijvoorbeeld per gebruikerregistratie, per download, per bezoek van een specifieke pagina, etc.<br/><a href="%s" target="_blank">Meer hulp in onze Knowledge Base</a>',
'More help in our Knowledge Base'=>'Meer hulp in onze Knowledge base',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Banner rotator is een speciaal type banner die andere banners laat roteren.<br/>Wanneer partners de rotator in de pagina plaatsen, laat de rotator banners zien die zijn toegewezen aan de rotator, waardoor de bezoeker elke banner elke keer zal zien wanneer hij de partners pagina bezoekt.<br/><a href="%s" target="_blank">Meer help in onze Knowledge Base</a>',
'Branding free'=>'Merknaam vrij',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Merknaam vrij is een speciale optie die de mogelijkheid geeft de links in de footer van panelen en inschrijfformulieren aan te passen van "Powered by %s" naar uw eigen tekst en link.<br/><a href="%s" target="_blank">Meer hulp in onze Knowledge Base</a>',
'Commission Groups'=>'Commissie Groepen',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Commissie groepen bieden de mogelijkheid  om verschillende commissies in te stellen voor verschillende gebruikers binnen dezelfde campagne.<br/><a href="%s" target="_blank">Meer hulp in onze Knowledge Base</a>',
'CPM commissions'=>'CPM commissies',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'CPM (cost per mille) commissies zijn een speciaal type commissie die worden gegeven voor 1000 impressie, dit betekent dat een banner 1000 keer getoond is<br/><a href="%s" target="_blank">Meer hulp in onze Knowledge Base</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Geforceerde matrix geeft u de mogelijkheid het aantal referalls van subpartners wat elke partner kan verwijzen te beperken. Het betekent dat elke partner een specifiek aantal kinderen kan hebben. <a href="%s" target="_blank">Meer details in onze Knowledge Base</a>',
'Hosting'=>'Hosting',
'Hosting of %s on  %s servers.'=>'Hosting van %s op  %s servers.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Meerdere valuta maken het mogelijk om verkopen in meerdere valuta te traceren. <br/><a href="%s" target="_blank">Meer hulp in onze Knowledge Base</a>',
'Multiple merchants'=>'Meerdere handelaars',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Standaard, zijn alle campagnes in %s publiek, wat betekent dat alle partners deze kunnen zien en promoten. Prive campagnes functie bieden de mogelijkheid om prive campagnes te maken, welke alleen zichtbaar zijn voor geselecteerde partners.<br/><a href="%s" target="_blank">Meer hulp in onze Knowledge Base</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Het laat u toe om speciale typen promo materialen te maken, opnieuw te merken e-books. U kunt uw PDF e-book een keer maken en het uploaden naar %s. Uw partners partners krijgen automatisch hun eigen opnieuw gemerkte kopie van het book, met hun naam, partner links, teksten etc. Het is niet verplicht om Windows programma\'s te moeten draaien, zij downloaden simpelweg de opnieuw gemerkte PDF.  Het opnieuw merken is automatisch in de achtergrond gedaan.<br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Recurring commissies maken het mogelijk om uw partners te belonen voor herhalende betalingen, voor bijvoorbeeld hosting of lidmaatschap. <br/><a href="%s" target="_blank">Meer hulp in onze Knowledge Base</a>',
