'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Het is mogelijk de volgende waarden te gebruiken in ID: {9} - zal worden vervangen door elk karakter in range [0-9], {z} - zal worden vervangen door elk karakter in range [a-z], {Z} - zal worden vervangen door elk karakter in range [A-Z], {X} - zal worden vervangen door elk karakter in range [0-9a-zA-Z], alle andere karakters zullen worden gekopieerd naar refid zoals u specificeert in het format. Voorbeeld van een goed format is bijvoorbeeld {ZZZ}-{XXXXX}-{999}',
